// import components
import PublicRoute from "../utils/PublicRoute.js";

// import styles
import "./style.min.css";

const Work = () => {
  const content = (
    <>
      <div className="work-options">
        <div className={`work-option ${sitesActive && "work-option-active"}`}>
          SITES
        </div>
        <div className={`work-option ${appsActive && "work-option-active"}`}>
          APPS
        </div>
        <div className={`work-option ${gamesActive && "work-option-active"}`}>
          GAMES
        </div>
        <div className={`work-option ${miscActive && "work-option-active"}`}>
          MISC
        </div>
      </div>
    </>
  );

  return <PublicRoute content={content} />;
};

export default Work;
